		# temp for condition : $17
		# first address of A : 0000 dec = 0x0000 hex
		# first address of B : 1300 dec = 0x0514 hex
		# first adderss of C : 2600 dec = 0x0A28 hex
		# $18 used as temp for any index before access
		# $19 used as value of A[i][k]
		# $20 used as value of B[k][j]
		# $21 used as value of C[i][j]

		# sizing variables 
		addi $8, $0, 40		# ROWS of A
		addi $9, $0, 40		# COLS of A
		addi $10, $0, 40	# COLS of B

		# Loops counters
		add $11, $0, $0		# counter i
		add $12, $0, $0		# counter j
		add $13, $0, $0		# counter k
	
		# addresses
		ori $14, $0, 0		# first index of A
		ori $15, $0, 0		# first index of B
		ori $16, $0, 0		# first index of C

Loop1:

		add $12, $0, $0		# initilize j by 0			
Loop2:

		add $13, $0, $0		# initilize k by 0
Loop3:

		# prepare A[i][k] by the equation A[i][k] = 0 + (i*colsA + k)*4  (*4 is for byte addressing mode)
		add $24, $9, $0		# num1 = colsA
		add $25, $11, $0	# num2 = i
		jal Mul_Fun			# call mul(colsA, i), result in $23
		add $18, $23, $13	# $18 = i*colsA + k
		# for byte memory shift by 2 and for word by 0 (important and don't delete)
		sll $18, $18, 2		# prepare for addrressing mode
		lw $19, 0($18)		# $19 = A[i][k]
		
		# prepare B[k][j] by the equation B[k][j] = 0 + (k*colsB + j)*4  (*4 is for byte addressing mode)
		add $24, $10, $0	# num1 = colsB
		add $25, $13, $0	# num2 = k
		jal Mul_Fun			# call mul(colsB, k), result in $23
		add $18, $23, $12	# $18 = k*colsB + j
		# for byte memory shift by 2 and for word by 0 (important and don't delete)
		sll $18, $18, 2		# prepare for addrressing mode
		lw $20, 1300($18)	# $20 = B[k][j]
		
		# call Mul_Fun to prepare value of Mul_fun(A[i][k], B[k][j])
		add $24, $19, $0	# num1 = A[i][k]
		add $25, $20, $0	# B[k][j]
		jal Mul_Fun			# call Mul_Fun(A[i][k], B[k][j]), result in $23
		add $21, $23, $0	# move the result to $21
		
		# prepare C[i][j] by the equation C[i][j] = 0 + (i*colsC + j)*4  (*4 is for byte addressing mode)
		add $24, $10, $0	# num1 = colsC = colsB
		add $25, $11, $0	# num2 = i
		jal Mul_Fun			# call mul(colsC, i), result in $23
		add $18, $23, $12	# $18 = i*colsC + 12
		# for byte memory shift by 2 and for word by 0 (important and don't delete)
		sll $18, $18, 2		# prepare for addrressing mode
		lw $23, 2600($18)	# load value of C[i][j]
		add $21, $21, $23	# $21 += current value of C[i][j]
		sw $21, 2600($18)	# store to MEM  = C[i][j] += Mul_fun(A[i][k], B[k][j])
		
		# check the counter and continue Loop3 or exit
		addi $13, $13, 1	# k++
		slt $17, $13, $9	# $17 = 1 if and only if k < cols A
		bne $17, $0, Loop3	# if $17!=0, then go to Loop3 again
		
		# increment Loop2 counter (j) and check to exit or continue
		addi $12, $12, 1	# j++
		slt $17, $12, $10	# $17 = 1 if and only if j < cols B
		bne $17, $0, Loop2	# if $17!=0, then go to Loop2 again
		
		# increment Loop1 counter (i) and check to exit or continue
		addi $11, $11, 1	# i++
		slt $17, $11, $8	# $17 = 1 if and only if i < rows A
		bne $17, $0, Loop1	# if $17!=0, then go to Loop1 again
		
		j finish			# end program, to avoid calling functions

	
# mul function uses registers (22/23/24/25)
# $22 :	counter
# $23 :	output
# $24 :	num1
# $25 :	num2
Mul_Fun :  
		ANDI $23, $0, 0  	# mulOut = 0 (initilize) 
		ADDI $22, $25, -1 	# i = num2-1 (initilize by value of num2-1) 
		BGEZ $22, Mul_Loop
		JR $31
Mul_Loop :   
		ADD  $23, $23, $24 	# mulOut += num1 
		ADDI $22, $22, -1 	# i-- 
		BGEZ $22, Mul_Loop
		JR $31				
		
		
finish: nop